"simpleText":"Zulu"}}],"defaultAudioTrackIndex":0}},"videoDetails":{"videoId":"45ETZ1xvHS0","title":"London Vacation Travel Guide | Expedia","lengthSeconds":"373","keywords":["trip","explore","attractions","London travel guide","tourist","London","guide","vacation","tourism","expedia","travel","London vacations","visit","yt:cc=off","West end","Big Ben","england","Buckingham Palace","London Eye","Covent Garden","Trafalgar Square","Piccadilly Circus","Tower Bridge","Westminster Abbey","Hyde Park","Royal Albert Hall","St James Park","The West End","Tate Modern","The British Museum"],"channelId":"UCGaOvAFinZ7BCN_FDmw74fQ","isOwnerViewing":false,"shortDescription":"Catch a glimpse of the famous London town! Or more than a glimpse – we’ll show you through the whole city.\n\nWhen ready, browse vacation packages to London: https://www.expedia.com/London.d178279.Destination-Travel-Guides\n\nA trip to #London might as well be a trip through history. This city is full of modern construction mixed with ancient buildings. \n\nYour London #vacation must include St. Paul’s Cathedral, one of its most well-known churches. You’ll also want to see the Tower of London, the Palace of Westminster, and Westminster Abbey for exquisite examples of the city’s famous architectural landmarks. Walk or jog through numerous green spaces, among them Hyde Park and Green Park, in the center of London.\n\nContinue your London #sightseeing in the West End, where you’ll find ancient buildings converted into modern shops, restaurants, bars, and shows. You’ll find one of the largest theatre districts in the world here, and can take in a different play almost every night of the week. \n\nClimb aboard the London Eye and see the old and new parts of the city all at once.\n\nFor now, we hope you enjoy watching this #travel #guide as much as we enjoyed making it. \n\nMore travel information around London: https://www.expedia.com/London.dx178279\n\nSubscribe to Expedia’s YouTube Channel for great travel videos urches. You’ll also want to see the Tower of London, the Palace of Westminster, and Westminster Abbey for exquisite examples of the city’s famous architectural landmarks. Walk or jog through numerous green spaces, among them Hyde Park and Green Park, in the center of London.\n\nContinue your London "},{"text":"#sightseeing","navigationEndpoint":{"clickTrackingParams":"CP8CENzXBBgJIhMI8MPn3ful9wIV8-nmCh3JowXQ","commandMetadata":{"webCommandMetadata":{"url":"/hashtag/sightseeing","webPageType":"WEB_PAGE_TYPE_BROWSE","rootVe":6827,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"FEhashtag","params":"6gUNCgtzaWdodHNlZWluZw%3D%3D"}},"loggingDirectives":{"trackingParams":"CP8CENzXBBgJIhMI8MPn3ful9wIV8-nmCh3JowXQ","visibility":{"types":"12"}}},{"text":" in the West End, where you’ll find ancient buildings converted into modern shops, restaurants, bars, and shows. You’ll find one of the largest theatre districts in the world here, and can take in a different play almost every night of the week. \n\nClimb aboard the London Eye and see the old and new parts of the city all at once.\n\nFor now, we hope you enjoy watching this "},{"text":"#travel","navigationEndpoint":{"clickTrackingParams":"CP4CENzXBBgLIhMI8MPn3ful9wIV8-nmCh3JowXQ","commandMetadata":{"webCommandMetadata":{"url":"/hashtag/travel","webPageType":"WEB_PAGE_TYPE_BROWSE","rootVe":6827,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"FEhashtag","params":"6gUICgZ0cmF2ZWw%3D"}},"loggingDirectives":{"trackingParams":"CP4CENzXBBgLIhMI8MPn3ful9wIV8-nmCh3JowXQ","visibility":{"types":"12"}}},{"text":" "},{"text":"#guide","navigationEndpoint":{"clickTrackingParams":"CP0CENzXBBgNIhMI8MPn3ful9wIV8-nmCh3JowXQ","commandMetadata":{"webCommandMetadata":{"url":"/hashtag/guide","webPageType":"WEB_PAGE_TYPE_BROWSE","rootVe":6827,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"FEhashtag","params":"6gUHCgVndWlkZQ%3D%3D"}},"loggingDirectives":{"trackingParams":"CP0CENzXBBgNIhMI8MPn3ful9wIV8-nmC
